  [],\n\t\"revision_timestamp\": \"2015-09-26T23:45:56.983740\",\n\t\"name\": \"maps-of-shallow-water-banks-in-the-northwestern-hawaiian-islands-derived-from-moderate-resoluti\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Shallow-water (generally, less than 30
  meters) bank areas in the Northwestern Hawaiian Islands were identified using semi-automated
  image analysis of Landsat 7 ETM+ satellite imagery. An area of approximately 10,000
  sq. km was mapped using the moderate-resolution satellite imagery and shallow-water
  bank maps were generated for the French Frigate Shoals, Gardner Pinnacles, Lisianski
  Island, Laysan Island, Maro Reef, Necker Island, Nihoa Island, Pioneer Bank, Raita
  Bank, St. Rogatien Bank, the Brooks Banks, and the bank west of Nihoa. This project
  is a cooperative effort among the National Oceanic and Atmospheric Administration,
  State of Hawaii Department of Land and Natural Resources, and the U.S. Fish and
  Wildlife Service to produce benthic habitat maps and georeferenced imagery for the
  Northwestern Hawaiian Islands. This project was conducted in support of the U.S.
  Coral Reef Task Force.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
